Quotes2 = ["Наша внутрішньо-політична праця скерована на те, щоб дослівно охопити ввесь загал громадянства, щоб дійти до кожного Українця, як причетного, так і непричетного до загального громадського життя, однаково — в рамцях того життя, чи поза ними, і незалежно від них.", "Найважливіша справа — здобути безпосередній вплив, включити у нашу боротьбу найбільшу і найвартіснішу їх частину. Тому за об'єкт своєї політичної праці беремо всю народню масу.", "Самостійну державу може здобути собі український народ тільки власною боротьбою і трудом.", "Внутрішньо-українська політика Організації Українських Націоналістів є і завжди мусить бути визвольницькою, а не партійною. Тобто, вона змагає до формування такого внутрішньо-українського життя, до створення такого укладу і взаємовідношення українських сил, які за всякої ситуації найкорисніші для визвольних змагань, а не тільки для скріплення позицій самої ОУН.", "Не можна робити принципів, політичних засад із того, що важливе тільки в одній, означеній ситуації чи є питанням тактики. Принципова політика полягає в тому, що послідовно прямуємо до однієї основної мети найуспішнішими, найпевнішими шляхами в усіх ситуаціях, при всіх змінах, не відступаючи від неї, здійснюючи той самий основний принцип.", "В нас тепер є один основний принцип, одна головна мета — Суверенна Соборна Українська Держава. До неї йдемо неухильно. А шлях наш — це шлях революційної визвольної боротьби. Він у нас єдиний тому, що він єдино певний, і єдино можливий.", "В усякій боротьбі і в усякій розумній політиці сенс полягає в тому, щоб, жертвуючи малими, частинами позиціями і вартостями, здобути головну мету. В цьому полягає всяка перемога, виграш. А пожертвувані, втрачені вартості — це ціна перемоги. Що більша мета, що тяжче змагання — то більші бувають жертви.", "Наша перемога — це перемога нашої ідеї, повне її здійснення. Другорядною справою є те, яку частину реалізуємо ми самі, яку — інші, а яку — спільно. Наш обов'язок — зробити самим найбільше, скільки стане наших сил, одночасно докласти старань, щоб і інші робили якнайбільше.", "Нашим природним середовищем стало вже змагання, змістом нашого життя — боротьба.", "Революційне змагання — це національна боротьба в площині духовності, культури, боротьба суспільно-політична й мілітарна, за повне знищення існуючого стану, його змісту й за побудову цілком нового, під кожним оглядом кращого стану, який відповідає потребам і бажанням українського народу.", "Хто будує на невластивих для нашого ґрунту світоглядових підвалинах, той, навіть при добрій волі й найкращих намаганнях, не поставить нічого тривкого, тільки помножить руїни.", "Без власної держави, без визволення, отже і без визвольної боротьби, Україна не може мати ані свободи, ані добробуту, ані якої-небудь тіні демократії.", "Якщо завтра на зміну большевизмові прийде інша форма російського імперіялізму, то він так само насамперед звернеться всіма своїми силами проти самостійности України, на її поневолення. Російський народ, як і досі, буде нести той імперіялізм, робитиме все, щоб тримати Україну в поневоленні.", "Чистий, незаплямлений крутійствами й компромісами зі злом український націоналізм вийде переможцем з важкого, але величного змагання проти сатанічної большевицької Москви. Він переможе, бо в ньому велика Правда української нації, згідно з Божими законами, життя народів і людей у свободі й справедливості.", "Творення, формування кадрів для визвольної боротьби — це і є найсуттєвіше, головне завдання цілого революційного процесу.", "Основна частина боротьби революційної організації з ворогом — це і є боротьба за душу людини, за ідейний вплив на цілий нарід, за поширення ідеї й концепції визвольної революції серед найширших мас народу, захоплення їх цією ідеєю і через це приєднання їх на бік визвольної боротьби.", "Ідеї українського націоналізму й героїчні подвиги революційної боротьби розбуджують глибоко приспані, сковані большевицькими дибами енергію і найвищі вартості козацьких нащадків."]

